pragma solidity >=0.6.0 <0.8.0;
// pragma experimental ABIEncoderV2;

/*
import "https://github.com/OpenZeppelin/openzeppelin-contracts/blob/v3.4.0/contracts/access/Ownable.sol";
import "https://github.com/OpenZeppelin/openzeppelin-contracts/blob/v3.4.0/contracts/math/SafeMath.sol";*/

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";

interface VPU {
    function balanceOf(address account) external view returns (uint);
    function transfer(address dst, uint rawAmount) external returns (bool);
}

interface VPunks {
    function userMintCount(address) external view returns (uint256);
}

contract ClaimVPU is Ownable {
    VPU constant VPUAccount = VPU(0xb0821559723dB89e0Bd14FEE81E13a3aaE007e65); // mainnet
    VPunks constant VPunksAccount = VPunks(0xe92FDDD633008C1bca6E738725d2190cD46DF4a1); // mainnet

    mapping (address => uint256) public userClaimCount;
    uint public expirationTime;

    uint256 amountForClaim = 500e18; // 500 VPU
    
    // ----------------------------------------------------------------------------
    constructor(uint expirationAfterDay) {
        expirationTime = SafeMath.add(block.timestamp, 1 days * expirationAfterDay);
    }

    function claim() public {
        require(block.timestamp <= expirationTime, "ClaimVPU::claim: expired");
        uint256 minted = VPunksAccount.userMintCount(msg.sender);
        require(minted > 0 && minted > userClaimCount[msg.sender], "ClaimVPU::claim: nothing is newly minted");
        uint256 newClaim = SafeMath.mul(SafeMath.sub(minted, userClaimCount[msg.sender]), amountForClaim);
        require(getVPUBalance() >= newClaim, "ClaimVPU::claim: insufficient balance");
        userClaimCount[msg.sender] = minted;
        VPUAccount.transfer(msg.sender, newClaim);
    }

    // ----------------------------------------------------------------------------
    function ownerWithdrawVPU(address payable recipient, uint256 amount) external onlyOwner {
        require(block.timestamp > expirationTime, "ClaimVPU::claim: not expired");
        VPUAccount.transfer(recipient, amount);
    }

    // ----------------------------------------------------------------------------
    function getClaimCount(address account) public view returns (uint256, uint256) {
        return (VPunksAccount.userMintCount(account), userClaimCount[account]);
    }

    function getVPUBalance() public view returns (uint256) {
        return (VPUAccount.balanceOf(address(this)));
    }
}
